var ContentPage = ART.Class(ART.Group, {"group_initialize": ART.Group.prototype.initialize, "initialize": function(content){
	this.group_initialize();
	var rows = content.split(/\r\n/);
	for (var i = 0, l = rows.length; i < l; i++){
		var dot = (/^\- /).test(rows[i]);
		if (dot){
			this.grab(
				new ART.Ellipse(12, 12)
					.fill('rgb(31, 107, 167)')
					.move(152, 315 + i * 50 - rows.length * 25)
			);
		}
		var text = new ART.Text(!dot ? rows[i] : rows[i].substr(2), {"font-family": "Segoe UI", "font-size": "35px"})
			.fill("#ffffff")
			.move(dot ? 180 : 150, 300 + i * 50 - rows.length * 25);
		this.grab(text);
	}
}});

var viewer = new ART(document.body.clientWidth, document.body.clientHeight).inject(document.body);
viewer.toElement().style.position = 'absolute';
var container = new ART.Group(1280, 720).resizeTo(document.body.clientWidth, document.body.clientWidth * 720 / 1280).inject(viewer);

var page = -1, lastPage = -1, pages = [];

var loc = '';

function load(content){
	var sections = content.split(/\r?\n\r\n/g);
	
	pages = [ new Page1().inject(container).hide() ];
	for (var i = 0, l = sections.length; i < l; i++)
		pages.push(new ContentPage(sections[i]).inject(container).hide());
	pages.push(
		new Page2().inject(container).hide(),
		new Page3().inject(container).hide()
	);

	window.onhashchange = function(){
		if (lastPage == -1) lastPage = page;
		page = loc.length > 1 ? Number(loc.substr(1)) : 0;
		if (isNaN(page) || page < 0 || page > pages.length - 1) page = 0;
		animate();
	};

	window.onhashchange();

};

var viewerElement = viewer.toElement();
var skipAnim = false; //ART.VML && ART.prototype == ART.VML.prototype;
var startTick,
	timer,
	animate = function(){
		if (timer) return;
		startTick = +new Date();
		timer = setInterval(tick, 1000 / 60);
	},
	tick = function(){
		var i = (+new Date() - startTick) / 400;
		if (i > 1 || skipAnim){
			clearInterval(timer);
			timer = false;
			//container.moveTo(0, 0);
			//viewerElement.style.left = '0px';
			viewerElement.style.msTransform = '';
			viewerElement.style.webkitTransform = '';
			return;
		}
		if (i > 0.5){
			if (lastPage > -1){ pages[lastPage].hide(); lastPage = -1; }
			pages[page].show();
			x = -1 + i;
		} else x = i;
		//container.moveTo(x * viewer.width * 2, 0);
		//viewerElement.style.left = (x * viewer.width * 2) + 'px';
		viewerElement.style.msTransform = 'translateX(' + (x * viewer.width * 2) + 'px)';
		viewerElement.style.webkitTransform = 'translate3D(' + (x * viewer.width * 2) + 'px, 0px, 0px)';
	};

var previous = function(event){
	loc = '#' + (page <= 0 ? pages.length - 1 : page - 1);
onhashchange();
	return false;
};

var next = function(event){
	loc = '#' + (page >= pages.length - 1 ? 0 : page + 1);
onhashchange();
	if (event && event.preventDefault) event.preventDefault();
	return false;
};

on('keyup', function(event){
	if (event.which == 37 || event.keyCode == 37) return previous();
	else return next();
});
on('click', next);
on('touchstart', function(event){ event.preventDefault(); });
on('touchend', next, false);

on('resize', function(){

	viewer.resize(document.body.clientWidth, document.body.clientHeight);
	container.resizeTo(document.body.clientWidth, document.body.clientWidth * 720 / 1280);
	
}, false);

var request = xhr();
request.open('GET', 'content.txt', true);
request.onreadystatechange  = function(){
	if (request.readyState == 4) load(request.responseText);
};
request.send();
